query:
mutation accountManagementDisableAccount ( $accountId:ID! ) {
	accountManagement ( accountId:$accountId ) {
		disableAccount  {
			accountInfoDisableAccountPayload: accountInfo {
				id 
				name 
				description 
				timeZone 
				type 
				tenancy 
				audit  {
					createdBy
					createdTime
				}

				plan 
				status 
			}
		}

	}	
}
